import React from "react";
import { setConfiguration } from "react-grid-system";

setConfiguration({ defaultScreenClass: "sm", gridColumns: 20 });
import "./Reset.css";
import "./Typography.css";
import "./App.css";
import About from "./pages/About";

function App() {
  return (
    <div>
      <About />
    </div>
  );
}

export default App;
